import React from 'react';
import './web.css';
const Home = ({ history }) => {
    const handleHome = () => {
        // Redirect to login page
        history.push('/');
      };
    
  return (
    <div className="container mt-5">
        <div class="row">
            <div class="col-12">
              <div class="card">
                                <div class="card-header">
                                    <h3 class="card-title dash-head">Signal HMU</h3>
                                    
                                </div>
                                <div class="card-body table-responsive p-0" >
                                    <table class="table table-head-fixed text-nowrap">
                                        <thead>
                                            <tr>
                                                <th>Sl.No</th>
                                                <th>Device ID</th>
                                                <th>Created On</th>
                                                <th>Status</th>
                                                <th>View Live Data</th>
                                            </tr>
                                        </thead>
                                        <tbody id="device-data"></tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>      <button  className="btn btn-danger button-left" onClick={handleHome}>Logout</button>
    </div>
  );
};

export default Home;
